import React, { useState, useEffect,} from 'react';
import ReactPlayer from 'react-player';
// import { Link } from 'react-router-dom';
import { IconButton, InputBase, AppBar, Toolbar, Typography, Box, Drawer, ListItemIcon, ListItemText,Popover,Avatar, Button} from '@mui/material';

import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';














import spimage from './images/spimage.jpg'



import { AiOutlineLike} from "react-icons/ai";
import { AiOutlineDislike } from "react-icons/ai";
import { PiShareFatThin } from "react-icons/pi";
import { LiaDownloadSolid } from "react-icons/lia";
import { IoArrowForward } from "react-icons/io5";
import { CiCircleMore } from "react-icons/ci";

import kamarke from './images/kamarke.jpg';
import nachre from './images/nachre.jpg';
import nathuniya from './images/nathuniya.jpg';
import halka from './images/halka.jpg';



import userimage1 from './images/image1.jpeg';
import userimage2 from './images/image2.jpeg'
import userimage3 from './images/image3.jpeg';
import userimage4 from './images/image4.jpeg';
import userimage5 from './images/image5.jpeg';
import userimage6 from './images/image6.jpeg';
import userimage7 from './images/image7.jpeg';
import userimage8 from './images/image8.jpeg';
import userimage9 from './images/image9.jpeg';
import userimage10 from './images/image10.jpeg';
import userimage11 from './images/image11.jpeg';
import userimage12 from './images/image12.jpeg';


// import './Cartt.css';
import './Home.css'
import { List, ListItem } from '@mui/material';


const Home = ({data}) => {

  const containerStyle = {
    backgroundColor: '#181818',
    color: '#fff',
    padding: '20px',
    borderRadius: '10px',
    maxWidth: '700px',
    margin: '20px auto',
    fontFamily: 'Arial, sans-serif',
  };

  const headerStyle = {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: '15px',
  };

  const titleStyle = {
    fontSize: '20px',
    fontWeight: 'bold',
    marginRight: '10px',
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
    maxWidth: 'calc(100% - 100px)', // Adjust based on available space
  };

  const subscribeStyle = {
    display: 'flex',
    alignItems: 'center',
  };

  const channelInfoStyle = {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '15px',
  };

  const channelLogoStyle = {
    width: '40px',
    height: '40px',
    borderRadius: '50%',
    marginRight: '10px',
  };

  const subscribeButtonStyle = {
    marginLeft: '10px',
    padding: '8px 16px',
    backgroundColor: '#ff0000',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontWeight: 'bold',
  };

  const actionButtonStyle = {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'space-between',
    width: 'auto',
    backgroundColor: '#282828',
    padding: '6px 15px',
    borderRadius: '25px',
    cursor: 'pointer',
    marginRight: '10px',
  };

  const iconStyle = {
    fontSize: '16px',
    marginRight: '5px',
  };

  const actionContainerStyle = {
    marginLeft:'150px',
    display: 'flex',
    alignItems: 'center',
  };











  const [selectedVideo, setSelectedVideo] = useState(null);
  const [searchQuery, setSearchQuery] = useState('');

  const [image1, setImage1] = useState([
    { id: 1, source: kamarke, description: "Aanali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  1", category: 'Category 1',userchannel: 'coding', view: 1021340,userimage: userimage1 },
    { id: 2, source: nachre, description: "dfgfanali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  2", category: 'Category 2',userchannel: 'kids', view: 23467,userimage: userimage2 },
    { id: 3, source: nathuniya, description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  3", category: 'Category 1',userchannel: 'cartoon', view: 3234,userimage: userimage3 },
    { id: 4, source: halka, description: "fghanali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  4", category: 'Category 2',userchannel: 'best song', view: 4087,userimage: userimage4 },
    { id: 5, source: kamarke, description: "Manali Trance | Yo Yodfh Honey Singh x Neha Kakkar x Lisa  5", category: 'Category 1',userchannel: 'commercial', view: 98755,userimage: userimage5 },
    { id: 6, source: nachre, description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  6", category: 'Category 2',userchannel: 'user 6', view: 67345,userimage: userimage6 },
    { id: 7, source: nathuniya, description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  7", category: 'Category 1',userchannel: 'user 7', view: 79879,userimage: userimage7 },
    { id: 8, source: halka, description: "oiManali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  8", category: 'Category 2',userchannel: 'user 8', view: 80987,userimage: userimage8 },
    { id: 9, source: kamarke, description: "xManali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  9", category: 'Category 1',userchannel: 'user 9', view: 345679,userimage: userimage9 },
    { id: 10, source: nachre, description: "vanali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  10", category: 'Category 2',userchannel: 'user 10', view: 1435670,userimage: userimage10 },
    { id: 11, source: nathuniya, description: "qanali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  11", category: 'Category 1',userchannel: 'user 11', view: 132451,userimage: userimage11 },
    { id: 12, source: halka, description: "wanali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa  12", category: 'Category 2',userchannel: 'user 12', view: 457612,userimage: userimage12 }
  ]);

  
  const [video1, setVideo1] = useState([
    { id: 1, source: 'https://www.youtube.com/watch?v=kAKGLx2i6Sk', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 1", category: 'Category 1',userName: 'coding',userimage: userimage1 },
    { id: 2, source: 'https://www.youtube.com/watch?v=obLXVRO_DJU&list=RDobLXVRO_DJU&start_radio=1', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 2", category: 'Category 2', userName: 'kids',userimage: userimage2 },
    { id: 3, source: 'https://www.youtube.com/watch?v=KoK0c4_HDXw&list=RDKoK0c4_HDXw&start_radio=1', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 3", category: 'Category 1', userName: 'cartoon',userimage: userimage1 ,userimage: userimage3},
    { id: 4, source: 'https://www.youtube.com/watch?v=TONEjZwkf_U&list=RDGMEMCMFH2exzjBeE_zAHHJOdxgVMTONEjZwkf_U&start_radio=1', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 4", category: 'Category 2', userName: 'best song',userimage: userimage4 },
    { id: 5, source: 'https://www.youtube.com/watch?v=kAKGLx2i6Sk', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 5", category: 'Category 1',userName: 'commercial',userimage: userimage5 },
    { id: 6, source: 'https://www.youtube.com/watch?v=obLXVRO_DJU&list=RDobLXVRO_DJU&start_radio=1', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 6", category: 'Category 2', userName: 'user 6',userimage: userimage6 },
    { id: 7, source: 'https://www.youtube.com/watch?v=KoK0c4_HDXw&list=RDKoK0c4_HDXw&start_radio=1', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 7", category: 'Category 1', userName: 'user 7',userimage: userimage7 },
    { id: 8, source: 'https://www.youtube.com/watch?v=TONEjZwkf_U&list=RDGMEMCMFH2exzjBeE_zAHHJOdxgVMTONEjZwkf_U&start_radio=1', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 8", category: 'Category 2', userName: 'user 8',userimage: userimage8 },
    { id: 9, source: 'https://www.youtube.com/watch?v=kAKGLx2i6Sk', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 9", category: 'Category 1',userName:'user 9',userimage: userimage9 },
    { id: 10, source: 'https://www.youtube.com/watch?v=obLXVRO_DJU&list=RDobLXVRO_DJU&start_radio=1', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 10", category: 'Category 2', userName: 'user 10',userimage: userimage10 },
    { id: 11, source: 'https://www.youtube.com/watch?v=KoK0c4_HDXw&list=RDKoK0c4_HDXw&start_radio=1', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 11", category: 'Category 1', userName: 'user 11',userimage: userimage11 },
    { id: 12, source: 'https://www.youtube.com/watch?v=TONEjZwkf_U&list=RDGMEMCMFH2exzjBeE_zAHHJOdxgVMTONEjZwkf_U&start_radio=1', description: "Manali Trance | Yo Yo Honey Singh x Neha Kakkar x Lisa Haydon | lyrics video 12", category: 'Category 2', userName: 'user 12',userimage: userimage12 },
  ]);

  const [sideImages, setSideImages] = useState([]);
  const [sideVideos, setSideVideos] = useState([]);
  const [isOpen, setIsOpen] = useState(false);

  const toggleSidebar = () => {
    setIsOpen(!isOpen); // Toggle the value of isOpen
  };

  const goToAbout = (index, isMainImage) => {
    const selectedSource = isMainImage ? video1[index].source : sideVideos[index].source;
    const category = isMainImage ? video1[index].category : sideVideos[index].category;
    setSelectedVideo(selectedSource);
    filterSideVideos(category);
  }

  const filterSideVideos = (category) => {
    const filteredVideos = video1.filter(video => video.category === category);
    setSideVideos(filteredVideos);
    const filteredImages = image1.filter(image => image.category === category);
    setSideImages(filteredImages);
  }

  const goBack = () => {
    setSelectedVideo(null);
  }

  useEffect(() => {
    if (video1.length > 0) {
      const initialCategory = video1[0].category;
      filterSideVideos(initialCategory);
    }
  }, [video1]);



  const handleSearchInputChange = (event) => {
    setSearchQuery(event.target.value);
  };


//   const filteredImages = image1.filter(item =>
//     item.description.toLowerCase().includes(searchQuery.toLowerCase())
//   );



  const filteredImages = image1.filter(item =>
    item.description.toLowerCase().includes(searchQuery.toLowerCase()) ||
    item.category.toLowerCase().includes(searchQuery.toLowerCase()) ||
    item.userchannel.toLowerCase().includes(searchQuery.toLowerCase())
  );
  


  
  

  return (
    <>
        {/* <input type="search" id='search' placeholder='Search' value={searchQuery} onChange={handleSearchInputChange}/>  */}

        {!selectedVideo && (
          <List style={{marginLeft:'auto',marginRight:'auto',display:'flex',overflow:'auto',scrollbarWidth: 'none',width:'97.4%',height:'30px',backgroundColor:'rgb(15,15,15)',marginBottom:'',marginTop:'-25px',position:'fixed',borderRadius:''}}>
